import React, { useState } from "react";
import "./Body.css";

const Body = () => {
  const [text, setText] = useState("");
  const handleOnChange = (e) => {
    setText(e.target.value);
  };
  return (
    <div>
      <input type="text" onChange={handleOnChange} />
      <div>{text}</div>
    </div>
  );
};

export default Body;
